#! /usr/bin/env perl

# 

$SIG{INT} = \&catch_sigint;

$builddir = shift;
$srcdir   = shift;
$tmppfx   = shift;

$verbose = 0;



# Verify that we have all the executables and datafiles we need for the test.
@h3progs = ("hmmpgmd2msa_utest");
foreach $h3prog  (@h3progs) { if (! -x "$builddir/src/$h3prog")             { die "FAIL: didn't find $h3prog executable in $builddir/src\n";              } }

# create the files needed for the test
&create_test_hmmdb("$tmppfx.hmm");
@output = `$builddir/src/hmmpgmd2msa_utest  $tmppfx.hmm`;
    if ($? != 0) { die "FAIL: hmmpgmd2msa_utest failed\n"; }



unlink <$tmppfx.hmm*>;
print "ok\n";
exit 0;

sub do_cmd {
    $cmd = shift;
    print "$cmd\n" if $verbose;
    return `$cmd`;  
}

